var visited = [];
var points = 0;
var mode = null;

var stageWidth = 1500;
var stageHeight = 750;

var stage = new Konva.Stage({
  container: 'world',
  width: stageWidth,
  height: stageHeight
});

var bglayer = new Konva.Layer();
stage.add(bglayer);

var background = new Image();
background.onload = function() {
  var bg = new Konva.Image({
    x: 0,
    y:0,
    image: background,
    width: stageWidth,
    height: stageHeight,
    preventDefault: false
  });
  bglayer.add(bg);
  bglayer.batchDraw();
}
background.src = "./assets/img/world.png";

function redraw_frontlayer() {
    frontlayer.removeChildren();

    for (var i = 0; i < cities.length; i++) {
        for (var j = 0; j < i; j++) {
            var dashedline = new Konva.Line({
                points: [cities[i]['x'], cities[i]['y'], cities[j]['x'], cities[j]['y']],
                stroke: '#ffb3b3',
                strokeWidth: 2,
                lineCap: 'round',
                lineJoin: 'round',
                dash: [20, 10]
            });
            frontlayer.add(dashedline);
        }
    }

    for (var i = 0; i < visited.length - 1; i++) {
        var strongline = new Konva.Line({
            points: [visited[i]['x'], visited[i]['y'], visited[i+1]['x'], visited[i+1]['y']],
            stroke: '#0000ff',
            strokeWidth: 4
        });
        strongline.fillLinearGradientStartPoint({ x: -50 })
                  .fillLinearGradientEndPoint({ x: 50 })
                  .fillLinearGradientColorStops([0, 'green', 1, 'yellow']);

        frontlayer.add(strongline);
    }

    cities.forEach((city) => {
      var circle = new Konva.Circle({
        x: city['x'],
        y: city['y'],
        radius: 18,
        fill: visited.indexOf(city) == -1 ? 'red' : '#0000ff',
        preventDefault: false
      });
      circle.on('click', function() {
          if (visited.indexOf(city) == -1) {
              visited.push(city);
              if (visited.length == cities.length) {
                  visited.push(cities[8]); // Add Villach in the end to "close" the cycle
              }
          }
          redraw_frontlayer();
          update_points_and_check_finished();
      })
      frontlayer.add(circle);
    });
    frontlayer.draw();
}

var frontlayer = new Konva.Layer();
redraw_frontlayer();
stage.add(frontlayer);

function fitStageIntoParentContainer() {
  var container = document.querySelector('#game-container');

  // now we need to fit stage into parent
  var containerWidth = container.offsetWidth - 30;
  // to do this we need to scale the stage
  var scale = containerWidth / stageWidth;

  stage.width(stageWidth * scale);
  stage.height(stageHeight * scale);
  stage.scale({ x: scale, y: scale });
  stage.draw();
}

fitStageIntoParentContainer();
// adapt the stage on any window resize
window.addEventListener('resize', fitStageIntoParentContainer);

